import React from "react";
import classnames from "classnames";
import { Nav, NavItem, NavLink } from "reactstrap";


const MyTabNav = (props) => {

  return (
    <div aria-label="myTabPane">
      <main>
        <Nav tabs>
          {props.projectNames.map((project, i) => (
            <NavItem key={i} className="font-weight-bold">
              <NavLink
                className={classnames({
                  active: activeTab === String(props.projectNames.indexOf(project)),
                })}
                onClick={() => {
                  toggle(String(projectNames.indexOf(project)));
                }}
              >
                {project}
              </NavLink>
            </NavItem>
          ))}
        </Nav>
      </main>
    </div>
  );
};

export default MyTabNav;
